library IEEE;
use IEEE.STD_LOGIC_1164.ALL;
use IEEE.STD_LOGIC_UNSIGNED.ALL;
use IEEE.NUMERIC_STD.ALL;

entity Draw_Memory is
    Port ( HP: in STD_LOGIC_VECTOR(9 downto 0);
           VP: in STD_LOGIC_VECTOR(9 downto 0);
           centerH : in STD_LOGIC_VECTOR (9 downto 0);
           centerV : in STD_LOGIC_VECTOR (9 downto 0);
           draw : out STD_LOGIC_vector (11 downto 0));
end Draw_Memory;

architecture Behavioral of Draw_Memory is

    constant size : integer := 100;

begin

    process(HP, VP, centerH, centerV)
    variable coord : STD_LOGIC_VECTOR (19 downto 0) := (others => '0');
